import React from "react";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark">
      <a className="navbar-brand" href="/">Book Search</a>
      <a className="navbar-brand" href="/reading-list">My Saved Books</a>
    </nav>
  );
}

export default Nav;
